-- -----------------------------------------------------
-- Table `team`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `team` ;

CREATE TABLE IF NOT EXISTS `team` (
  `id` SMALLINT NOT NULL AUTO_INCREMENT,
  `team_name` VARCHAR(45) NOT NULL,
  `parent_id` SMALLINT NULL,
  `has_staff` SMALLINT,
  PRIMARY KEY (`id`),
  CONSTRAINT `fk_team_team`
    FOREIGN KEY (`parent_id`)
    REFERENCES `team` (`id`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION)
ENGINE = InnoDB;


-- -----------------------------------------------------
-- Table `staff`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `staff` ;

CREATE TABLE IF NOT EXISTS `staff` (
  `id` SMALLINT NOT NULL AUTO_INCREMENT,
  `first_name` VARCHAR(100) NOT NULL,
  `last_name` VARCHAR(100) NOT NULL,
  PRIMARY KEY (`id`))
ENGINE = InnoDB;


-- -----------------------------------------------------
-- Table `role`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `role` ;

CREATE TABLE IF NOT EXISTS `role` (
  `id` SMALLINT NOT NULL AUTO_INCREMENT,
  `role_name` VARCHAR(25) NOT NULL,
  PRIMARY KEY (`id`))
ENGINE = InnoDB;


-- -----------------------------------------------------
-- Table `profile`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `profile` ;

CREATE TABLE IF NOT EXISTS `profile` (
  `profile_ref` VARCHAR(4) NOT NULL,
  `team_id` SMALLINT NOT NULL,
  `staff_id` SMALLINT NOT NULL,
  `role_id` SMALLINT NOT NULL,
  `valid_from` DATE NOT NULL,
  `valid_until` DATE NULL,
  PRIMARY KEY (`profile_ref`),
  CONSTRAINT `fk_profile_team1`
    FOREIGN KEY (`team_id`)
    REFERENCES `team` (`id`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION,
  CONSTRAINT `fk_profile_agent1`
    FOREIGN KEY (`staff_id`)
    REFERENCES `staff` (`id`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION,
  CONSTRAINT `fk_profile_role1`
    FOREIGN KEY (`role_id`)
    REFERENCES `role` (`id`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION)
ENGINE = InnoDB;


-- -----------------------------------------------------
-- Table `survey_response`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `survey_response` ;

CREATE TABLE IF NOT EXISTS `survey_response` (
  `id` INT NOT NULL AUTO_INCREMENT,
  `profile_ref` VARCHAR(4) NOT NULL,
  `response_time` TIMESTAMP NOT NULL,
  `first_call_resolution` SMALLINT NULL,
  `agent_quality` SMALLINT NULL,
  `promoter_score` SMALLINT NULL,
  `comment` VARCHAR(1024) NULL,
  PRIMARY KEY (`id`),
  CONSTRAINT `fk_survey_consumer _profile1`
    FOREIGN KEY (`profile_ref`)
    REFERENCES `profile` (`profile_ref`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION)
ENGINE = InnoDB;


-- -----------------------------------------------------
-- Table `call_record`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `call_record` ;

CREATE TABLE IF NOT EXISTS `call_record` (
  `call_ref` INT NOT NULL,
  `call_leg` TINYINT NOT NULL,
  `profile_ref` VARCHAR(4) NOT NULL,
  `survey_response_id` INT NULL,
  `call_time` TIMESTAMP NOT NULL,
  PRIMARY KEY (`call_ref`, `call_leg`, `profile_ref`),
  CONSTRAINT `fk_call_record _profile1`
    FOREIGN KEY (`profile_ref`)
    REFERENCES `profile` (`profile_ref`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION,
  CONSTRAINT `fk_call_record _survey_response 1`
    FOREIGN KEY (`survey_response_id`)
    REFERENCES `survey_response` (`id`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION)
ENGINE = InnoDB;


